import React from 'react'; 
import '../css/NavigationBar.css';

const NavigationBar = () => {
    return (
        <div className="button-container">
            <button>Home</button>
            <button>Spacrafts</button>
            <button>Planets</button>
        </div>
    )
}

export default NavigationBar;
